import React from "react";

function CreateAreaColor(props) {
  return (
    <div className="create-color">
      {/* Yellow */}
      <input
        id="#f8c51b"
        type="radio"
        name="color"
        checked={props.color === "#f8c51b"}
        onChange={() => props.setColor("#f8c51b")}
      />
      <label
        htmlFor="#f8c51b"
        style={{
          backgroundColor: "#f8c51b",
        }}
      ></label>

      {/* Red */}
      <input
        id="#f96262"
        type="radio"
        name="color"
        checked={props.color === "#f96262"}
        onChange={() => props.setColor("#f96262")}
      />
      <label
        htmlFor="#f96262"
        style={{
          backgroundColor: "#f96262",
        }}
      ></label>
      {/* LightBlue */}
      <input
        id="#23d5e7"
        type="radio"
        name="color"
        checked={props.color === "#23d5e7"}
        onChange={() => props.setColor("#23d5e7")}
      />
      <label
        htmlFor="#23d5e7"
        style={{
          backgroundColor: "#23d5e7",
        }}
      ></label>
      {/* Purple */}
      <input
        id="#dda6F7"
        type="radio"
        name="color"
        checked={props.color === "#dda6F7"}
        onChange={() => props.setColor("#dda6F7")}
      />
      <label
        htmlFor="#dda6F7"
        style={{
          backgroundColor: "#dda6F7",
        }}
      ></label>
      {/* DarkBlue */}
      <input
        id="#2198d3"
        type="radio"
        name="color"
        checked={props.color === "#2198d3"}
        onChange={() => props.setColor("#2198d3")}
      />
      <label
        htmlFor="#2198d3"
        style={{
          backgroundColor: "#2198d3",
        }}
      ></label>
    </div>
  );
}

export default CreateAreaColor;
